DROP TABLE IF EXISTS `subscribers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `subscribers` (
  `channel_id` bigint unsigned NOT NULL,
  `subscriber_id` bigint unsigned NOT NULL,
  `subscription_start_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время начала подписки',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  KEY `subscribers_fk_channel_id` (`channel_id`),
  KEY `subscribers_fk_subscriber_id` (`subscriber_id`),
  CONSTRAINT `subscribers_fk_channel_id` FOREIGN KEY (`channel_id`) REFERENCES `channels` (`id`),
  CONSTRAINT `subscribers_fk_subscriber_id` FOREIGN KEY (`subscriber_id`) REFERENCES `channels` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Подписчики';
/*!40101 SET character_set_client = @saved_cs_client */;

